(2809, 355, '_form', '<section class=\"form-wrap\">\n	<div class=\"row\">\n\n		<div class=\"col-12 text-center\">\n			<h2 class=\"layout-h1\">Send us an enquiry</h2>\n                        <p>Fill out the form below and one of our helpful staff will be in touch with you within 1 business day!</p>\n		</div>\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> First Name *</label>\n			[text* first-name class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> Last Name *</label>\n			[text* last-name class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> Email *</label>\n			[email* your-email class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12 col-lg-6\">\n			<div class=\"form-group\">\n			<label> Phone (inc country code)</label>\n			[tel your-phone class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12\">\n			<div class=\"form-group\">\n		<label> Company</label>\n		[text business-name class:form-control] \n		</div>\n		</div>\n\n		<div class=\"col-12\">\n			<div class=\"form-group\">\n		<label> Tell us more about your group (location, type, interests)</label>\n		[textarea your-message class:form-control placeholder \"Start typing...\"] \n		</div>\n		</div>\n		\n		<div class=\"col-12 text-right\">\n			<button type=\"submit\" class=\"btn btn-jump\">Submit</button>\n		</div>\n	</div>\n</section>'),
