(5, 1, '2018-08-15 02:36:43', '2018-08-15 02:36:43', '<section class=\"form-wrap\">\r\n	<div class=\"row\">\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> First Name *</label>\r\n			[text* first-name class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> Last Name *</label>\r\n			[text* last-name class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> Email *</label>\r\n			[email* your-email class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12 col-lg-6\">\r\n			<div class=\"form-group\">\r\n			<label> Phone (inc country code)</label>\r\n			[tel your-phone class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12\">\r\n			<div class=\"form-group\">\r\n		<label> Company/Business Name</label>\r\n		[text business-name class:form-control] \r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12 col-lg-4\">\r\n			<div class=\"form-group\">\r\n		<label> Est. Group Size</label>\r\n		[number group-size class:form-control] \r\n		</div>\r\n		</div>\r\n		<div class=\"col-12 col-lg-4\">\r\n			<div class=\"form-group\">\r\n		<label> Est. Budget (USD)</label>\r\n		[number budget id:event-budget class:form-control] \r\n		</div>\r\n		</div>\r\n		<div class=\"col-12 col-lg-4\">\r\n			<div class=\"form-group\">\r\n		<label> Event Date</label>\r\n		[text event-date id:event-date class:date-field class:form-control]\r\n		</div>\r\n		</div>\r\n\r\n		<div class=\"col-12\">\r\n			<div class=\"form-group\">\r\n		<label> Tell us more about your group (location, type, interests)</label>\r\n		[textarea your-message class:form-control placeholder \"Start typing...\"] \r\n		</div>\r\n		</div>\r\n		\r\n		<div class=\"col-12 text-right\">\r\n			<button type=\"submit\" class=\"btn btn-jump\">Submit</button>\r\n		</div>\r\n	</div>\r\n</section>\n1\nGrupo \"[your-subject]\"\n[first-name] [last-name] <wordpress@grupo.loc>\ntest@gmail.com\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n[your-phone]\r\n[business-name]\r\n[group-size]\r\n[budget]\r\n[event-date]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Grupo (http://grupo.loc:802)\nReply-To: [your-email]\n\n\n\n\nGrupo \"[your-subject]\"\nGrupo <wordpress@grupo.loc>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Grupo (http://grupo.loc:802)\nReply-To: test@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact Us', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2018-08-22 04:34:51', '2018-08-22 04:34:51', '', 0, 'http://grupo.loc:802/?post_type=wpcf7_contact_form&#038;p=5', 0, 'wpcf7_contact_form', '', 0),
(9, 1, '2018-08-15 03:24:35', '2018-08-15 03:24:35', '<h1>About Us</h1>\r\n<h2>The Grupo Team would love hear from you! Please fill out the form below and you can expect to hear from us very soon!</h2>\r\nSed viverra lectus a magna cursus, in euismod diam tempor. Nunc sit amet semper urna. Vestibulum lobortis condimentum felis in molestie. Praesent sed ligula eu nulla porttitor porta. Morbi tincidunt dolor sed dui fringilla imperdiet. Mauris at tempor ante. Duis vel neque leo. Suspendisse at urna ac leo fermentum vulputate id ut ipsum. Morbi quis massa sollicitudin, efficitur ante sed, tempus risus.', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2018-08-25 23:14:33', '2018-08-25 23:14:33', '', 0, 'http://grupo.loc:802/?page_id=9', 0, 'page', '', 0),
(11, 1, '2018-08-15 03:25:22', '2018-08-15 03:25:22', '<h2>Reward, inspire and forge bonds within your team with a one of a kind team building experience in Mexico! Discover how we help companies of all sizes build healthy, productive and more connected teams through our innovative and fun team building activities!</h2>\r\nCompany culture doesn’t happen over night; however, this is a good start! Take the next step by exploring our most popular team building activities below and contact us for a custom proposal specific to your group!\r\n\r\n&nbsp;\r\n<h3>Why choose us?</h3>\r\n<strong>We’re reliable.</strong> We have a strong track record of success with a wide range of groups and companies. Our experienced team of event coordinators and creative directors will work with you to find the solution that best fits your groups needs. We take the time to listen to your priorities and then provide the perfect solution to fit your individual group dynamics.\r\n\r\n<strong>We’re flexible.</strong> Like a yoga instructor! We can create custom events with a special theme, specific time frame, group dynamic, or unique location. We also cater to a wide range of budgets depending on your needs.\r\n\r\n<strong>We’re dedicated.</strong> We understand that you are busy and you need information quickly. We can handle short lead times and often provide solutions at a moment’s notice when you need it most. You will see fast, quality results when you partner with us.\r\n\r\n<strong>We’re bilingual.</strong> Our team building activities are available in English or Spanish anywhere in Mexico.\r\n\r\n<strong>We’re responsive.</strong> We are able to immediately produce a professional group activity proposal that meets your needs. We realize that you often require details now, not a week from now. We respect that and will work smarter to get you an innovative team building concept ready to present!', 'Team Building', '', 'publish', 'closed', 'closed', '', 'team-building', '', '', '2018-08-24 12:42:44', '2018-08-24 12:42:44', '', 0, 'http://grupo.loc:802/?page_id=11', 0, 'page', '', 0),
